import './App.css';
import Button from "./Button";

function App() {
    const handleClick = () => {
      console.log("Button clicked");
    };
  return (
    <div className="App">
      <header className="App-header">
        <div className="navbar-div">
          <Button className="navbar-button" onClick={handleClick()} children="Children"/>
        </div>
      </header>
    </div>
  );
}

export default App;
